// Displays the ASCII art
void displayAsciiArt(char asciiArt[84][141], int row, int col)
{
    for (int i = 0; i < row; i++)
    {
        for (int j = 0; j < col; j++)
        {
            cout << asciiArt[i][j];
        }
        cout << endl;
    }
}

// Calling all decryption funtions
void decryptAsciiArt(char asciiArt[84][141], int row, int col)
{
    ToggleCaseAndShift(asciiArt, row / 3, row, col / 3, 2 * (col / 3));
    shiftCharBackward(asciiArt, 0, row / 3, 0, col);
    ToggleCaseAndShiftRow(asciiArt, row / 3, row, 2 * (col / 3), col);
    horizontalSwap(asciiArt, row / 3, row, 0, col / 3);
}




void ToggleCaseAndShift(char asciiArt[84][141], int rowTop, int rowBottom, int colLeft, int colRight)
{
    char C;
    for (int i = rowTop; i < rowBottom; i++)
    {
        for (int j = colLeft; j < colRight; j++)
        {

            C = asciiArt[i][j];
            if (islower(C))
            {
                C -= 32;
            }
            asciiArt[i][j] = C - 1;
        }
    }
}

void shiftCharBackward(char asciiArt[84][141], int rowTop, int rowBottom, int colLeft, int colRight)
{
    char C;
    for (int i = rowTop; i < rowBottom; i++)
    {
        for (int j = colLeft; j < colRight; j++)
        {
            C = asciiArt[i][j];

            if (  (i%2 == 0) && (j%2) == 0)
            {
            asciiArt[i][j] = C - 5;
            }
            else
            {
                asciiArt[i][j] = C -3;
            }

        }
    }
}

void ToggleCaseAndShiftRow(char asciiArt[84][141], int rowTop, int rowBottom, int colLeft, int colRight)
{
    char C;
    for (int i = rowTop; i < rowBottom; i++)
    {
        for (int j = colLeft; j < colRight; j++)
        {
            if (i % 3 == 0)
            {
                C = asciiArt[i][j];
                if (islower(C))
                {
                    C -= 32;
                }
                asciiArt[i][j] = C;
            }
        }
    }
}

void horizontalSwap(char asciiArt[84][141], int rowTop, int rowBottom, int colLeft, int colRight)
{
    for (int i = rowTop; i <= rowBottom; i++)
    {
        for (int first = colLeft, last = colRight; first < last; ++first, --last)
        {
            char temp = asciiArt[i][first]; // temp variable for swap
            asciiArt[i][first] = asciiArt[i][last];
            asciiArt[i][last] = temp;
        }
    }
}
